                  chat={'normal'}
                  power="member"
                  callBack={() => { }}
                  defaultColor={"#111"}
                />
              );
            })
            : null} */}
          {
            Object.keys(followingList).map((key) => {
              return (
                <UserObj
                  key={key}
                  uid={Number(key)}
                  nickName={userList[Number(key)].userDisplayName}
                  profileImage={userList[Number(key)].userProfileUrl}
                  status={userList[Number(key)].userStatus}
                  chat={'normal'}
                  power="member"
                  callBack={() => { }}
                  defaultColor={"#111"}
                />
              );
            })
          }
        </div>
      </div>
    </div>
  );
}
